import React, { useState } from 'react';
import { TextField, Button, Grid, Typography } from '@mui/material';

const UserDetails = () => {
  const [userData, setUserData] = useState({
    tipoPessoa: 'pessoaFisica',
    nome: '',
    cpf: '',
    numero: '',
    email: '',
    enderecos: [],
  });

  const handleChange = (event) => {
    setUserData({ ...userData, [event.target.name]: event.target.value });
  };

  const handleAddEndereco = () => {
    const novoEndereco = {
      endereco: '',
      acoes: '',
    };
    setUserData({ ...userData, enderecos: [...userData.enderecos, novoEndereco] });
  };

  const handleSave = () => {
    // Implementar a lógica para salvar os dados do usuário
    console.log('Dados do usuário:', userData);
  };

  return (
    <div>
      <Typography variant="h5">Cadastro de Usuário</Typography>
      <div>
        <label>Tipo de Pessoa:</label>
        <select name="tipoPessoa" value={userData.tipoPessoa} onChange={handleChange}>
          <option value="pessoaFisica">Pessoa Física</option>
          <option value="pessoaJuridica">Pessoa Jurídica</option>
        </select>
      </div>
      <div>
        <TextField
          label="Nome"
          name="nome"
          value={userData.nome}
          onChange={handleChange}
        />
      </div>
      <div>
        <TextField
          label="CPF"
          name="cpf"
          value={userData.cpf}
          onChange={handleChange}
        />
      </div>
      <div>
        <TextField
          label="Número"
          name="numero"
          value={userData.numero}
          onChange={handleChange}
        />
      </div>
      <div>
        <TextField
          label="E-mail"
          name="email"
          value={userData.email}
          onChange={handleChange}
        />
      </div>
      <div>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Typography variant="h6">Endereços</Typography>
          </Grid>
          {userData.enderecos.map((endereco, index) => (
            <React.Fragment key={index}>
              <Grid item xs={8}>
                <TextField
                  label="Endereço"
                  name={`endereco-${index}`}
                  value={endereco.endereco}
                  onChange={(event) => {
                    const updatedEnderecos = [...userData.enderecos];
                    updatedEnderecos[index].endereco = event.target.value;
                    setUserData({ ...userData, enderecos: updatedEnderecos });
                  }}
                />
              </Grid>
              <Grid item xs={4}>
                <TextField
                  label="Ações"
                  name={`acoes-${index}`}
                  value={endereco.acoes}
                  onChange={(event) => {
                    const updatedEnderecos = [...userData.enderecos];
                    updatedEnderecos[index].acoes = event.target.value;
                    setUserData({ ...userData, enderecos: updatedEnderecos });
                  }}
                />
              </Grid>
            </React.Fragment>
          ))}
        </Grid>
      </div>
      <div>
        <Button variant="contained" onClick={handleAddEndereco}>Adicionar Endereço</Button>
      </div>
      <div>
        <Button variant="contained" color="primary" onClick={handleSave}>Salvar</Button>
      </div>
    </div>
  );
};

export default UserDetails;
